import React from "react";
import { NavLink } from "react-router-dom";

function Home() {
  return (
    <div>
      <NavLink
        to={"/addwords"}
        className=" bg-green-700 w-[12.202562538133009vw] h-[6.101281269066504vw] p-2"
      >
        Kelime Ekle
      </NavLink>
      <NavLink
        to={"/words"}
        className=" bg-green-700 w-[12.202562538133009vw] h-[6.101281269066504vw]"
      >
        Kelimeler
      </NavLink>
    </div>
  );
}

export default Home;
